import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Homepage />} />
        <Route path="/accept" element={<Accept />} />
        <Route path="/decline" element={<Decline />} />
      </Routes>
    </Router>
  );
}

export default App;
